import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import AppRoutes from './Routes.js';
import './App.css';

const App = () => {
  return (
    <Router>
        <AppRoutes />
        <footer className="App-footer">
          <p>&copy; 2024 Your Company</p>
        </footer>
    </Router>
  );
};

export default App;
